import './BottomButtons.css';
const BottomButtons = ({todo}) => {
    return(
        <div className="bottom-buttons">
            <span><a>{todo.length} Items Left</a></span>
            <span>Clear Completed</span>
        </div>
    );
};
export default BottomButtons;
